import jsPDF from "jspdf";

const generateReport = (data, frase = "Constancia de jubilacion") => {
  const doc = new jsPDF({ orientation: "p", unit: "mm", format: "legal" });

  var img =
    "";

  doc.addImage(img, "PNG", 10, 17, 35, 35);
  doc.text(45, 20, frase);

  doc.text(130, 30, "Republica de Guatemala");
  doc.text(130, 37, "Instituto de previsin militar");
  doc.text(130, 44, "Servicio de prestaciones");

  doc.line(15, 60, 200, 60);

  doc.text(30, 70, "Datos del jubilado");
  doc.text(30, 77, `Nombre: ${data.nombre}`);
  doc.text(30, 84, `DPI: ${data.DPI}`);

  doc.line(15, 90, 200, 90);

  doc.text(
    10,
    110,
    `Por este medio se hace constar que ${data.nombre} quien se identifica con el`
  );
  doc.text(
    10,
    117,
    `Documento Personal de Identificacin No. ${data.DPI} comenzo los tramites`
  );
  doc.text(
    10,
    124,
    `correspondientes para optar a la jubilacin militar. Ha cumplico con los `
  );
  doc.text(
    10,
    131,
    `requerimientos dispuesto para optar a la jubilacin, ha brindado servicios `
  );
  doc.text(
    10,
    138,
    `por ${data.Servicio} aos y que es beneficiario de un porcentajeequivalente a`
  );
  doc.text(
    10,
    145,
    `${data.Porcentaje}% y de acuerdo a su ultimo pago registrado es beneficiario`
  );
  doc.text(10, 152, `de una pensin equivalente a:  Q.${data.Pension}.00.`);
  doc.text(
    10,
    180,
    `Sin ninguna otro particular que agregar, se imprime esta constancia en una`
  );
  doc.text(10, 187, `hoja de papel bond tamao carta.`);

  doc.output("dataurlnewwindow", "constancia.pdf");
};

export default generateReport;
